package day0413;

public class ForEachLoopString {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String[] names = {"shah","yar","fatma","jessie"};
		
		for (String eachItem:names) {
			System.out.println(eachItem);
		}
		
		double [] prices = {44.9,75.80,65.78};
		
		for (double eachDbl : prices) {
			System.out.println(eachDbl);
		}

	}

}
